script: |
  super -f text -I q203.spq | sort > q203.out

inputs:
  - name: q203.spq
    data: |
      SELECT DISTINCT - MIN ( + 6 ) FROM tab1 (FORMAT parquet) WHERE NOT col0 * + - col1 + + 15 + - - 60 BETWEEN - + 74 * - col1 AND + col1;
  - name: tab1

outputs:
  - name: q203.out
    data: |
      -6
